import axios from "axios";

export const LoginUserpost = async (mydata,dispatch) => {
  const config = {
    headers: { "Content-Type": "application/json" },
  };
  const req = await axios.post("/api/v1/login", mydata, config);
  const data = req.data.user
  console.log(data);
  dispatch(LoginUserpost(data));

};
